import React, { Component } from "react";
class Contact extends Component {
	render() {
		return (
			<div id="contact" className="section-content">
				<h2>Where to find us ?</h2>
				<div className="row">
					<div className="col">
						<p>
							Parth Kansara <br />
							Contact No: +91-9029480621 <br />
							Facebook: https://www.facebook.com/kparth01 <br />
							Instagram: bitz_2501
							<a href="#" class="fa fa-facebook"></a>
						</p>
					</div>
					<div className="col">
						<p>Siddhi Mehta: +91-7620388389</p>
					</div>
				</div>
			</div>
		);
	}
}
export default Contact;
